  public static int[] longestIncreasingSubsequence( int[] list ) {
    int n = list.length;
    int len = 1;
    int end = 1;
    int[] l = new int[n];
    int[] prev = new int[n];
    l[0] = 1;
    for(int i = 1; i < n; ++i) {
      l[i] = 1;
      for(int j = 0; j < i; ++j) {
        if(list[j] < list[i]) {
          if(l[i] < 1 + l[j]) {
            l[i] = 1 + l[j];
            prev[i] = j;
          }
        }
      }
      if(len < l[i]) {
        len = l[i];
        end = i;
      }
    }
    
    int[] out = new int[len];
    int i = end;
    int added = len-1;
    while(added >= 0) {
      out[added--] = list[i];
      i = prev[i];
    }
    return out;
  }
  
  public static int[] longestDecreasingSubsequence( int[] list ) {
    int n = list.length;
    int len = 1;
    int end = 1;
    int[] l = new int[n];
    int[] prev = new int[n];
    l[0] = 1;
    for(int i = 1; i < n; ++i) {
      l[i] = 1;
      for(int j = 0; j < i; ++j) {
        if(list[j] > list[i]) {
          if(l[i] < 1 + l[j]) {
            l[i] = 1 + l[j];
            prev[i] = j;
          }
        }
      }
      if(len < l[i]) {
        len = l[i];
        end = i;
      }
    }
    
    int[] out = new int[len];
    int i = end;
    int added = len-1;
    while(added >= 0) {
      out[added--] = list[i];
      i = prev[i];
    }
    return out;
  }
